export class SubmitAuctionRequestCall extends ethereum.Call {
  get inputs(): SubmitAuctionRequestCall__Inputs {
    return new SubmitAuctionRequestCall__Inputs(this);
  }

  get outputs(): SubmitAuctionRequestCall__Outputs {
    return new SubmitAuctionRequestCall__Outputs(this);
  }
}

export class SubmitAuctionRequestCall__Inputs {
  _call: SubmitAuctionRequestCall;

  constructor(call: SubmitAuctionRequestCall) {
    this._call = call;
  }

  get _title(): string {
    return this._call.inputValues[0].value.toString();
  }

  get _description(): string {
    return this._call.inputValues[1].value.toString();
  }

  get _durationMinutes(): BigInt {
    return this._call.inputValues[2].value.toBigInt();
  }

  get _minimumBid(): BigInt {
    return this._call.inputValues[3].value.toBigInt();
  }

  get _nftContract(): Address {
    return this._call.inputValues[4].value.toAddress();
  }

  get _nftTokenId(): BigInt {
    return this._call.inputValues[5].value.toBigInt();
  }
}

export class SubmitAuctionRequestCall__Outputs {
  _call: SubmitAuctionRequestCall;

  constructor(call: SubmitAuctionRequestCall) {
    this._call = call;
  }

  get requestId(): BigInt {
    return this._call.outputValues[0].value.toBigInt();
  }
}
